7u \\equiv 23 \\pmod{50}

Next, we can subtract 7 from both sides, which gives us:

u \\equiv 23 - 7 \\pmod{50}

u \\equiv 16 \\pmod{50}

u \\equiv 16 + 50k \\pmod{100}

where k is an integer.

The two smallest solutions are u = 16 and u = 66.

The average of the two smallest solutions is (16 + 66) / 2 = 41.

