The matrix norm of a matrix $A$ is defined as $\\|A\\| = \\max\\limits_{\\|x\\| = 1} \\|Ax\\|$. In our case, we want to find the maximum value of $\\left\\| \\begin{pmatrix} 2 \\times 10^{18} & 3 \\times 10^{18} \\\\ 0 & -2 \\times 10^{18} \\end{pmatrix} \\bold{v} \\right\\|$ when $\\|\\bold{v}\\| = 1$.

